        }

        if( from != owner() && to != owner() &&from != address(this)  ){
            if(_startTimeForSwap != 0 && !_isFinallyFee){
                if( block.timestamp > _startTimeForSwap + 7200 ) {
                    _buyMarketingFee = 0;
                    _buyLiquidityFee = 150;
                    _buyBurnFee = 50;
                    _sellMarketingFee = 0;
                    _sellLiquidityFee = 150;
                    _sellBurnFee = 50;
                    _isFinallyFee = true;
                } 
